cordova.define("com.jiedaibao.requestproxy.RequestProxy", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       requestProxy : function(address, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'RequestProxy',
            'requestProxy',
            [{
             "address": address
             }]
            );
       }
    }
  }
);
